import {IconInfo} from "../icons";

export default function TrackArtwork({ track }) {
  return (
    <div>
      <div className="inline-block relative w-20">
        {track.album.images.length && <img className="w-full" src={track.album.images[2].url} alt="Album Artwork" />}
        <div className="flex justify-center text-center absolute w-full h-full top-0 bottom-0 left-0 right-0 text-white opacity-0">
          <IconInfo />
        </div>
      </div>
    </div>
  )
}
